import { Route } from "react-router-dom";
import { BrowserRouter, Switch } from "react-router-dom";
import Header from "./Header";




export default function Body() {
    return ( <
        >
        <
        BrowserRouter >
        <
        Header >
        <
        Switch >
        <
        Route exact path = "/"
        component = { Header }
        /> <
        /Switch> <
        /Header> <
        /BrowserRouter> <
        />
    )
}
